import Authorization from "./components/Auth_&_Reg/Authorization";
import Header from "./components/Header";
import './modules/scss/header.scss';
import './css/App.css';

const AuthorizationPage = {
  titleText: 'Авторизация',
  signText: 'Зарегистрироваться',
  isRegisterPage: false
}

export default function App() {

  function ChangePage() {
    AuthorizationPage.isRegisterPage = AuthorizationPage.isRegisterPage
  }

  return (
    <>
      <div className="App">
        <Header isBeginPage={false}/>
        <Authorization onChangePage={ChangePage} page={AuthorizationPage} />
      </div>
    </>
  );
}
